The deltaray library makes it easy to read Delta Tables from Ray. By passing in a table_uri and version we’re able to access our Delta Table at a specific point in time as long as the underlying parquet files are available. The use of the vacuum command to save on storage costs would be one example of why a previous version of the Delta Table could become unavailable, you can read more about vacuum here . # External Libraries
import deltaray # Read the initially created version of the Delta Lake table
ds = deltaray.read_delta(table_uri, version=0)
ds.show() {'id': 0}
{'id': 1}
{'id': 2} # Read the second version of the Delta Lake table
ds = deltaray.read_delta(table_uri, version=1)
ds.show() {'id': 0}
{'id': 1}
{'id': 2}
{'id': 3}
{'id': 4}
{'id': 5} If you want the most recent version of the Delta Table, you don’t need to provide a version argument at all. You can see the result corresponds with the last update we made to our dummy dataset which overwrote all previous versions. # Read the current version of the Delta Lake table
ds = deltaray.read_delta(table_uri)
ds.show() {'id': 6}
{'id': 7}
